import React from "react";
import "./WhatWeDoData";
import "./css/WhatWeDo.css";
import { data } from "./WhatWeDoData";

function WhatWeDo() {
  return (
    <div className="what__we__do">
      <div className="WhatWeDo__header">
        <h1>What we do?</h1>
      </div>
      <div className="whatWeDo__activity">
        {data.map(({ id, path, title, link, text }) => (
          <div className={`${"class" + id}`}>
            <div className="whatwedo__image__container">
              <img src={path} alt="" className="whatwedo__image" />
            </div>
            <div className="whatwedo__title">
              <p>{title}</p>
            </div>
            <div className="whatwedo__text">
              {text}{" "}
              <div className="whatwedo__link">
                <p>{link}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default WhatWeDo;
